import React from "react";
import "./menu.css";

const Menu = () => {
  return (
    <>
      <div className="MenuSection">
        <div className="MenuContainer">
          <div className="Sidebar"></div>
          <div className="AlbaikInfo">
            <div className="Details">
              <h2>Nepal Albaik</h2>
              <h5>Restaurant & Bar</h5>
            </div>
            <div className="MenuList">
              <ul>
                <li>1</li>
                <li>2</li>
                <li>3</li>
                <li>4</li>
                <li>5</li>
                <li>6</li>
              </ul>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Menu;
